import React from 'react';

export default function Sidebar() {
  return (
    <div className="space-y-4">
      <div className="bg-white shadow p-4 rounded-lg">
        <h2 className="font-semibold mb-2">Actions</h2>
        <ul className="text-sm space-y-1">
          <li>Manage case log</li>
          <li>Manage your invoices</li>
        </ul>
      </div>
      <div className="bg-white shadow p-4 rounded-lg">
        <h2 className="font-semibold mb-2">Communications</h2>
        <p className="text-sm">Battery compliance update for vendor-fulfilled product listings</p>
        <p className="text-xs text-gray-500">Jun 26, 2025</p>
      </div>
    </div>
  );
}
